import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import Icon from './icon'

class Box extends Component {
  render() {
    return (
      <Icon
        percent={this.props.percent}
        code={this.props.code}
        type={this.props.type}
      />
    )
  }
}

export default Box
